export const updateCourse = ({
  _id = "",
  name = "",
  isBelongMiuul = false,
  duration = "",
  chapters = []
} = {}) => ({
  type: "UPDATE_COURSE",
  user: {
    _id,
    name,
    isBelongMiuul,
    duration,
    chapters
  }
});

export const removeCourse = () => ({
  type: "REMOVE_COURSE",
  user: {
    _id: "",
    name: "",
    isBelongMiuul: false
  }
});
